import React from 'react'

const PlaySynth = (props) => {

    const C1 = () => {
        props.synth.triggerAttackRelease('C1','8n');
    }
    const D1 = () => {
        props.synth.triggerAttackRelease('D1','8n');
    }
    const E1 = () => {
        props.synth.triggerAttackRelease('E1','8n');
    }
    const F1 = () => {
        props.synth.triggerAttackRelease('F1','8n');
    }
    const G1 = () => {
        props.synth.triggerAttackRelease('G1','8n');
    }
       return(
        <div id='wrapper'>
            <button id='button c' onClick={C1}>Click Me</button>
            <button id='button d' onClick={D1}>Click Me</button>
            <button id='button e' onClick={E1}>Click Me</button>
            <button id='button f' onClick={F1}>Click Me</button>
            <button id='button g' onClick={G1}>Click Me</button>
        </div>
       )
}

export default PlaySynth;
